        type="number"
        value={age}
        onChange={(e) => SetAge(e.target.value)}
        placeholder="Age"
      />
      {/* <p>
        {age} años humanos = {age * 7} años de perro
      </p> */}
    </>
  );
};

export default DogAgeCalculator;
